public List<Integer> addToArrayForm(int[] num, int k) {
            int length = num.length;
            List<Integer> res = new ArrayList<>();
            int plus = 0;
            int i = length - 1;
            for (; i >= 0 && k > 0; i--) {
                int t = k % 10;
                k /= 10;
                num[i] += t + plus;
                plus = 0;
                if (num[i] >= 10) {
                    plus = 1;
                    num[i] %= 10;
                }
            }
            // k=0knum
            if (k == 0) {
                if (plus == 1) {
                    while (i >= 0 && plus == 1) {
                        num[i]++;
                        plus = 0;
                        if (num[i] >= 10) {
                            plus = 1;
                            num[i] %= 10;
                        }
                        i--;
                    }
                    if (plus == 1) {
                        res.add(1);
                    }
                }
                for (int j = 0; j < length; j++) {
                    res.add(num[j]);
                }
            }
            // i<0k>0,knum
            else if (i < 0 && k > 0) {
                k += plus;
                Stack<Integer> st = new Stack<>();
                while (k > 0) {
                    st.add(k % 10);
                    k /= 10;
                }
                while(!st.empty()) {
                    res.add(st.pop());
                }
                for (int j = 0; j < length; j++) {
                    res.add(num[j]);
                }
            }
            return res;
        }

